import React from "react";

function Input(props) {

  return (
    <div className="radio">
      {props.ele==="All" ? <input type="radio" name={props.filter} checked=""/>:<input type="radio" name="category"/>}
      <label htmlFor="">{props.ele}</label>
    </div>
  );
}

export default Input;
